export  const PublicRoutes = [
    {
        path: '/',
        name: 'home',
        redirect: '/auth/login',
    },
    {
        path: '/auth/login',
        name: 'auth.login',
        component: () => import('../modules/Home.vue')
    },
    {
        path: '/admin',
        component: () => import('../modules/Dashboard.vue'),
        children: [
        { path: '', 
          name: 'admin.requests', 
          component: () => import('../modules/Request.vue')
        }
        
        ]
    },
    {
        path: '/*',
        name: 'notfound',
        redirect: '/auth/login'
    },
];
